import React from 'react';
import Card from './components/Card';
import './styles.css';

const App = () => {
  const cardsData = [
    { id: 1, title: 'Card 1', code: 'console.log("Card 1 Code");' },
    { id: 2, title: 'Card 2', code: 'console.log("Card 2 Code");' },
    { id: 3, title: 'Card 3', code: 'console.log("Card 3 Code");' },
    { id: 4, title: 'Card 4', code: 'console.log("Card 4 Code");' },
    { id: 5, title: 'Card 5', code: 'console.log("Card 5 Code");' },
    { id: 6, title: 'Card 6', code: 'console.log("Card 6 Code");' },
    { id: 7, title: 'Card 7', code: 'console.log("Card 7 Code");' },
    { id: 8, title: 'Card 8', code: 'console.log("Card 8 Code");' },
    { id: 9, title: 'Card 9', code: 'console.log("Card 9 Code");' },
    { id: 10, title: 'Card 10', code: 'console.log("Card 10 Code");' },
  ];

  return (
    <div className="app">
      {cardsData.map(card => (
        <Card key={card.id} title={card.title} code={card.code} />
      ))}
    </div>
  );
};

export default App;
